'''Implement binary search and insertion sort in python.'''def binary_search(arr, low, high, key):    while low <= high:        mid = (low + high) // 2        if arr[mid] < key:            low = mid + 1        else:            high = mid - 1    return lowdef insertion_sort(arr):    for i in range(1, len(arr)):        key = arr[i]        j = i - 1        index = binary_search(arr, 0, j, key)        while j >= index:            arr[j + 1] = arr[j]            j -= 1        arr[index] = key# Example usage:example = [45235, 323, 9, 975, 43565, 8900, 3234, 56356, ]insertion_sort(example)print(example)